import "./ContactUs.css";
import phone from "../../logos/Rectangle 24.png";

export const ContactUs = () => {
  return (
    <div className='wrapper'>
      <div className='section_wrapper'>
        <div className='section'>
          <div className='section_title'>Contact Us</div>
          <h2>Start your project with Brandit</h2>
          <p className='about_text'>Send us a message today to get started.</p>
        </div>
        <img className='about_img' src={phone} alt='' />
      </div>
    </div>
  );
};
